    "floor": MessageLookupByLibrary.simpleMessage("Пол"),
    "floor_billing_text_1": MessageLookupByLibrary.simpleMessage(
      "Керамзит полду жылуулоо жана үн изоляциясы үчүн колдонулат. Ал бетон, жыгач же жер негизиндеги полдорго ылайыктуу.\nКерамзит жылуулоочу материал катары кургак толтурууда же цемент-кум стяжкасынын курамында колдонулушу мүмкүн.\nАнын кемчилиги – нымды узак убакыт кармап турушу. Бул кемчилик гидроизоляцияны туура колдонуу менен жоюлат.\nИш баштаар алдында негиз тазаланып, тегиздиги текшерилет.\nКерамзит катмарынын оптималдуу калыңдыгы 80–100 мм.\nКеректүү көлөм бөлмөнүн аянтын орточо бийиктикке көбөйтүү аркылуу эсептелет. 10% запастык материал алуу сунушталат.\nБетон негиз гидроизоляциялык пленка менен жабылат.",
