    ),
    "floor_concrete_text_1": MessageLookupByLibrary.simpleMessage(
      "Бул ыкма цемент-кум стяжкасы бар бетон полдор үчүн колдонулат. Жылуулоочу материалдар пол жабуусу орнотулуудан мурун түздөн-түз бетонго же жер үстүнө төшөлөт.\nАдегенде бетон плита эски стяжкадан, таштандылардан жана чаңдан тазаланат. Дубал менен полдун кесилишиндеги боштуктар цемент эритмеси же герметик менен толтурулат.\nАндан соң гидроизоляция жасалат. Бул үчүн полимер-битумдуу эритмелер же пароизоляциялык пленка колдонулат. Бюджеттик вариант катары кадимки полиэтилен пленкасын колдонууга болот.",
    ),
    "floor_concrete_text_2": MessageLookupByLibrary.simpleMessage(
