    ),
    "floor_concrete_text_3": MessageLookupByLibrary.simpleMessage(
      "Кийинки этапта тандалган жылуулоочу материал төшөлөт: минералдык жүн, пенопласт же толтуруучу материалдар. Табак же рулон түрүндөгү жылуулоочу материалдар лагалардын ортосуна боштук калтырбай төшөлөт. Толтуруучу материал (мисалы, керамзит) маяктардын ортосуна куюлуп, металл эреже менен тегизделет.\nАндан соң фанера, ГВЛ, OSB же ДСП плиталарынан кара пол төшөлөт. Муздак көпүрөлөрдү болтурбоо үчүн эки катмар кылып, тигиштерди жылдырып төшөө сунушталат. Плиталар лагаларга өзүн-өзү бурагычтар менен бекитилет.\nАкырында акыркы пол жабуусу орнотулат.",
