    "floor_film_text_1": MessageLookupByLibrary.simpleMessage(
      "Эгер кара (черновой) пол жок болсо, пароизоляциялык пленканы колдонсо болот: аны жыгач брустардан жасалган обрешётканын үстүнө жайышат. Андан кийин салмагы жеңил болгон жылуулоочу материалдын катмары төшөлөт (мисалы, плиталар же рулон материалдар). Андан соң үстүнөн дагы бир пароизоляция катмары төшөлүп, тактай настил менен жабылат.\nПароизоляция катмарын кеминде 10 см внахлёст кылып төшөп, андан кийин курулуш степлери менен бекитүү керек. Кийинки этапта жыгач лагалардын үстүнө фанера же OSB барактары төшөлөт. Андан соң акыркы пол жабуусу (мисалы, подложка менен ламинат) орнотулат. Монтаж плинтустарды орнотуу менен аяктайт.",
