    "fundament_billing_material_title": MessageLookupByLibrary.simpleMessage(
      "Материалды тандоо: ",
    ),
    "fundament_billing_outro": MessageLookupByLibrary.simpleMessage(
      "Керамзит жана башка жеңил материалдарды колдонгон толтуруу ыкмасынын артыкчылыктарына аткаруунун жөнөкөйлүгү жана айрым башка ыкмаларга салыштырмалуу төмөн баа кирет. Бирок пенопласт же экструдирленген пенополистирол (XPS) сыяктуу атайын жылуулоочу материалдарга караганда, айрыкча жогорку жылуулоо көрсөткүчтөрү талап кылынганда, натыйжалуулугу төмөн болушу мүмкүн.\nБашка ыкмалардагыдай эле, фундаментти туура жылуулоо жана сиздин долбоорго ылайык материал/ыкманы туура тандоо үчүн тажрыйбалуу адистерге кайрылуу сунушталат.",
    ),
    "fundament_billing_prep_text": MessageLookupByLibrary.simpleMessage(
      "Башка жылуулоо ыкмаларындагыдай эле, фундаменттин бети кирден, чаңдан жана таштандыдан жакшы тазаланышы керек. Зарыл болсо фундаменттеги бузулган жерлер оңдолуп, гидроизоляция жасалат.\n\n",
    ),
    "fundament_billing_prep_title": MessageLookupByLibrary.simpleMessage(
      "Бетин даярдоо: ",
    ),
    "fundament_billing_steps_1_4": MessageLookupByLibrary.simpleMessage(
      "1. Фундаменттин бою менен анын толук тереңдигине чейин туурасы кеминде 80 см болгон траншея казылат. Андан соң фундаменттин дубалдары кирден, кумдан, чаңдан тазаланат жана фундамент кургатылат.\n2. Керамзит нымды сиңире аларын унутпоо керек, ошондуктан опалубканын ичине гидроизоляциялык материал (синтетикалык пленка, рубероид ж.б.) төшөлөт. Гидроизоляция жабыштыруу (оклеечный) же сүртүү (обмазочный) ыкмасы менен аткарылат. Сүртүү үчүн битум мастикасы колдонулат. Жабыштыруу ыкмасы рубероид же башка пленкалык жабууларды ылайыктуу курамга жабыштырууну билдирет.\n3. Траншея толтургуч менен толтурулат: түбүнө болжол менен 20 см кум төшөлүп, тыгыздалат, андан кийин курулуш керамзити же шагыл куюлат. Топурактын деңгээлине тең же бир аз жогору тегизделет.\n4. Жеңил жылуулоочу материал (мисалы, керамзит) фундаменттин айланасына керектүү бийиктикке чейин тегиз бөлүштүрүлөт. Толтуруу кол менен же атайын жабдуу аркылуу аткарылышы мүмкүн.",
    ),
    "fundament_billing_steps_5_6": MessageLookupByLibrary.simpleMessage(
      "5. Тыгыздоо. Материал толтурулгандан кийин катмарды тыгыздап, боштуктардын пайда болушун алдын алып, жылуулоонун бир калыпта болушун камсыз кылуу керек.\n6. Изоляция иштери бүткөн соң, имараттын сырткы дубалдарынын жанында туурасы 50–80 см болуп, үйдөн сыртка карай аздап эңкейиштүү отмостка жасалат. Отмостка керамзит катмарынын жылуулоосун күчөтүүгө жардам берет. Периметр боюнча 10–15 см бийиктикте опалубка орнотулуп, арматуралык тор төшөлөт да, бетон эритмеси куюлат. Гидроизоляцияны жакшыртуу үчүн бетонго атайын кошулма кошсо болот.",
    ),
    "fundament_billing_title": MessageLookupByLibrary.simpleMessage(
      "2. Фундаментти толтуруу ыкмасы менен жылуулоонун процесси",
    ),
    "fundament_btn_inside": MessageLookupByLibrary.simpleMessage(
      "Жылуулоо\nичтен",
