    "fundament_btn_outside": MessageLookupByLibrary.simpleMessage(
      "Жылуулоо\nтыштан",
    ),
    "fundament_description": MessageLookupByLibrary.simpleMessage(
      "Бетон – пайдубал курууда эң көп колдонулган материал. Анын жогорку жылуулук өткөргүчтүгү жана топурак менен түздөн-түз байланышы имараттын бүткүл периметри боюнча жылуулук жоготуулардын 20 пайызына чейин берет. Пайдубал өзгөчө жер төлөдөн жана биринчи кабаттагы туура эмес орнотулган жылуу полдон жылуулукту абдан күчтүү өткөрөт.\nПайдубалды жылуулоо жөнүндө кененирээк маалыматты бул бөлүмдөн окуй аласыз: ",
    ),
    "fundament_inside_intro": MessageLookupByLibrary.simpleMessage(
      "Айрым учурларда, эгер сырттан жылуулоо мүмкүн болбосо же натыйжасыз болсо, фундаментти ичтен жылуулоо жакшы вариант болушу мүмкүн. Ичтен жылуулоону эң натыйжалуу ыкмалардын бири катары пенополиуретанды чачуу (бүркүү) аркылуу аткарса болот.\n\n",
    ),
    "fundament_inside_note": MessageLookupByLibrary.simpleMessage(
      "Белгилей кетүүчү нерсе: фундаментти ичтен жылуулоо сырттан жылуулоого караганда азыраак натыйжалуу болушу мүмкүн, анткени ал фундаменттин өзүнүн түзүлүшү аркылуу жылуулук жоготууларын толук токтотпойт жана аны нымдан же айлана-чөйрөнүн таасиринен коргобойт. Бирок айрым учурларда бул жалгыз мүмкүн болгон ыкма болушу мүмкүн же башка жылуулоо ыкмалары менен бирге колдонулат.",
    ),
    "fundament_inside_prep_text": MessageLookupByLibrary.simpleMessage(
      "Башка жылуулоо ыкмаларындагыдай эле, фундаменттин бети кирден, чаңдан жана таштандыдан жакшы тазаланышы керек. Зарыл болсо, фундаменттеги бузулган жерлер оңдолуп, гидроизоляция жасалат.\n\n",
    ),
    "fundament_inside_prep_title": MessageLookupByLibrary.simpleMessage(
      "Бетин даярдоо: ",
