    "fundament_inside_title": MessageLookupByLibrary.simpleMessage(
      "ИЧТЕН\nЖЫЛУУЛОО",
    ),
    "fundament_inside_walls_text": MessageLookupByLibrary.simpleMessage(
      "Жылуулоо фундаменттин дубалдарынын ички бетине жылуулоочу материалдарды орнотуу аркылуу жүргүзүлөт. Көп учурда пенополистирол же минералдык пахта плиталары колдонулат; алар клей же атайын бекиткичтер менен дубалга бекитилет.\nТолтуруу: Андан кийин полдун деңгээлине чейин топурак, керамзит же кум менен толтурууга болот.\n\n",
    ),
    "fundament_inside_walls_title": MessageLookupByLibrary.simpleMessage(
      "Дубалдарды жылуулоо: ",
    ),
    "fundament_inside_waterproof_text": MessageLookupByLibrary.simpleMessage(
      "Жылуулоодон тышкары, нымдын жана суунун киришин алдын алуу үчүн фундаменттин ички беттерине гидроизоляция жасоо да сунушталат.\n\n",
    ),
    "fundament_inside_waterproof_title": MessageLookupByLibrary.simpleMessage(
      "Гидроизоляция: ",
    ),
    "fundament_intro": MessageLookupByLibrary.simpleMessage(
      "Фундаментти жылуулоо — бул имараттын фундаментин айланта жылуулоочу материалдарды колдонуу процесси. Бул жылуулук жоготууларын азайтып, имараттын энергиялык натыйжалуулугун жогорулатат. Айрыкча суук климатта бул курулушта же оңдоодо абдан маанилүү бөлүк болуп эсептелет.",
    ),
    "fundament_link": MessageLookupByLibrary.simpleMessage(
      "ПАЙДУБАЛДЫ ЖЫЛУУЛОО",
