    "fundament_outside_btn_backfill": MessageLookupByLibrary.simpleMessage(
      "ТОЛТУРУУ\nЫКМАСЫ",
    ),
    "fundament_outside_btn_foam": MessageLookupByLibrary.simpleMessage(
      "ПЕНОПЛАСТ\nНЕГИЗИНДЕГИ\nМАТЕРИАЛДАР МЕНЕН",
