    "fundament_outside_btn_pu": MessageLookupByLibrary.simpleMessage(
      "ФУНДАМЕНТТИ\nПЕНОПОЛИУРЕТАН\nМЕНЕН ЖЫЛУУЛОО",
    ),
    "fundament_outside_intro": MessageLookupByLibrary.simpleMessage(
      "Үйдүн фундамент дубалдарын үч негизги ыкма менен жылуулоого болот:",
    ),
    "fundament_outside_title": MessageLookupByLibrary.simpleMessage(
      "ТЫШТАН\nЖЫЛУУЛОО",
    ),
    "fundament_plastic_p1": MessageLookupByLibrary.simpleMessage(
      "Эң биринчи кадам — имараттын периметри боюнча туурасы болжол менен 1–1,5 м болгон траншея казып, фундаментти ачуу. Казуу фундаменттин толук тереңдигине чейин жүргүзүлөт, ал болсо топурактын тоңуу тереңдигине жараша болот.",
    ),
    "fundament_plastic_p2": MessageLookupByLibrary.simpleMessage(
      "Андан соң фундаменттин бетин металл кылдуу катуу щетка менен тазалаш керек. Мындан тышкары, фундаменттин жана цоколдун бети тегизделет — бул гидроизоляциялык материалдын узак кызмат кылышы үчүн маанилүү. Дубалдар алдын ала бекитилген торго жана маяк рейкаларга штукатурка сүйкөө аркылуу тегизделет. Иш бүткөндөн кийин штукатурканын толук кургашын күтүш керек.",
    ),
    "fundament_plastic_p3": MessageLookupByLibrary.simpleMessage(
      "Кийинки этап — фундаменттин сырткы дубалдарына жана цоколго гидроизоляциялык материалды колдонуу: алар битум мастикасынын катмары менен капталып, үстүнөн рулондук же барак түрүндөгү гидроизоляция (10 см жабышма «нахлёст» менен) чапталат. Барактарды астындагы абаны чыгарып кылдат түздөп, муундарын битум же битум мастикасы менен иштетүү керек.",
    ),
    "fundament_plastic_p4": MessageLookupByLibrary.simpleMessage(
      "Андан кийин жылуулоочу материал менен иш: пеноплекс (же башка материал) плиталарын фундаментке акрил клейи же органикалык эмес негиздеги башка клей менен чапташ керек. Клей чекиттеп, кеминде 5–6 жерге сүртүлөт. Фундаментке дюбель менен бекитүүгө болбойт — гидроизоляция бузулат.",
    ),
    "fundament_plastic_p5": MessageLookupByLibrary.simpleMessage(
      "Ар бир плитаны чаптагандан кийин клей катуусун күтүп туруу керек — болжол менен 1 мүнөт (бул убакыт кийинки плитаны даярдоого кетет). Пеноплексти «паз-гребень» системасы менен бекитебиз. Эгер пенопласт колдонулса, муундар менен жаракалар монтаждык көбүк (же клей) менен толтурулат. Плитанын арт жагына көбүктөн эркин сүрөт түшүрүп, дубалга бастырышат. Бирок бул учурда плиталарды дароо «зонтик» дюбелдери менен бекитүү керек, болбосо көбүк кеңейип, пеноплекс дубалдан ажырап кетиши мүмкүн.",
    ),
    "fundament_plastic_p6": MessageLookupByLibrary.simpleMessage(
      "«Зонтик» дюбелдерин орнотуу оңой: орточо эсеп менен 1 м² үчүн кеминде 5 бекитүү чекити талап кылынат. Перфоратор менен пеноплекс плитасы аркылуу бетонго сокур тешик тешип, дюбелдин таягын киргизип, акырында ортодогу\nкеңейтүүчү штырды балка менен кагып бекитет.",
    ),
    "fundament_plastic_p7": MessageLookupByLibrary.simpleMessage(
      "Андан соң экинчи катмар жылуулоону төшөйт: ал биринчи катмарга бекитилет жана биринчи катмардын муундары көрүнбөшү үчүн жылдыруу (смещение) менен орнотулат. Жылуулоо бекитилгенден кийин анын бетин штукатурка менен (айрыкча пенопласт) бекемдеп, армирлөөчү торго\n(мыктысы — стеклоткань) сүйкөйт.",
    ),
    "fundament_plastic_p8": MessageLookupByLibrary.simpleMessage(
      "Эритме кургагандан кийин траншея дарыя куму менен толтурулат. Фундаменттин көрүнгөн бөлүгү капталып, отмостка жасалат.\nПеноплекс менен отмостканы жылуулоо керамзитке жасалган конструкциядан айырмасы — кум-шағал жаздыкчанын үстүнө пеноплекс төшөлүп, анын үстүнөн арматураланган бетон отмостка куюлат. Отмостканын эңкейиши 1 погон метрге 2–3 см болушу керек.",
    ),
    "fundament_plastic_title": MessageLookupByLibrary.simpleMessage(
      "1. Фундаментти сырттан пенопласт\nнегизиндеги жылуулоочу\nматериал менен жылуулоо процесси",
    ),
    "fundament_pu_intro": MessageLookupByLibrary.simpleMessage(
      "Фундаментти сырттан жылуулоону да үйдүн негиз дубалдарына пенополиуретан бүркүү технологиясы аркылуу аткарса болот. Мындай иштерди адатта абанын температурасы нөлдөн жогору 10°Cдан төмөн болбогондо жүргүзүүгө мүмкүн. Бул материал жылуулоочу гана эмес, ошол эле учурда гидроизоляциялык функцияны да аткарат.",
    ),
    "fundament_pu_steps": MessageLookupByLibrary.simpleMessage(
      "Бардык иштер төрт этапта жүргүзүлөт:\n1. Фундаменттин бетин даярдоо (кирден, чаңдан ж.б. тазалоо).\n2. Пенополиуретанды бүркүп колдонуу.\n3. Бетин штукатуркалоо.\n4. Траншеяны кайра толтуруу жана отмостка жасоо.\nБул технологиянын өзгөчөлүгү — убакытты үнөмдөп, кошумча гидроизоляция иштерин көп учурда талап кылбагандыгында.",
    ),
    "fundament_pu_title": MessageLookupByLibrary.simpleMessage(
      "3. Фундаментти пенополиуретан менен жылуулоо процесси",
    ),
    "fundament_pu_warning": MessageLookupByLibrary.simpleMessage(
      "Маанилүү! Пенополиуретан тууралуу маалымат таанышуу максатында гана берилет. Бул материалды даярдоо жана андан кийин бүркүп колдонуу үчүн атайын жабдуу керек. Ал кыйла кымбат, ошондуктан бир жолу колдонуу үчүн сатып алуу көп учурда ылайыктуу чечим эмес. Жабдууну ижарага алуу кыйла пайдалуу, ал эми эң жакшысы — адиске кайрылуу, анткени мындай бүркүүчү жабдууларды туура колдонуу үчүн тиешелүү билим жана көндүмдөр талап кылынат.",
