    "fundament_warning": MessageLookupByLibrary.simpleMessage(
      "! Эгер үй мурда эле курулуп, узак убакыт пайдаланылып келсе, фундаментти ачып иштөө — өтө жоопкерчиликтүү процесс. Ал кылдат пландоону жана узак даярдыкты талап кылат.",
