    "humidity_description": MessageLookupByLibrary.simpleMessage(
      "Имараттын коргоочу конструкциялары үйдүн ичиндеги жылуулукту сактап, адам үчүн ыңгайлуу шарттарды камсыз кылышы керек. Дубалдарды курууда колдонулган материалдар жылуулук өткөрүмдүүлүгү төмөн болушу зарыл. Жылуулук өткөрүмдүүлүк — бул материалдын жылуулукту өткөрүү жөндөмү.\n\nКурулуш материалдарындагы нымдуулук алардын жылуулук өткөрүмдүүлүгүнө түздөн-түз таасир этет. Суунун жылуулук өткөрүмдүүлүгү абага караганда болжол менен 25 эсе жогору. Ошондуктан материалдын тешикчелеринде ным канчалык көп болсо, жылуулук ошончолук тез өткөрүлүп, имарат көбүрөөк жылуулук жоготот.\n\nКоргоочу конструкциялардагы жогорку нымдуулук жылуулоочу касиеттердин төмөндөшүнө жана имараттын кызмат өтөө мөөнөтүнүн кыскарышына алып келет. Айрыкча тоңуу жана эриш циклдери көп кайталанган шартта материалдардын бузулушу күчөйт.\n\nНымдуулуктун жогорулашына негизги себептер төмөнкүлөр болуп саналат: курулуш нымдуулугу, жер алдындагы ным, атмосфералык жаан-чачындар, эксплуатация учурундагы ным жана конденсаттын пайда болушу.\n\nАшыкча нымдуулук маселесин чечүү үчүн гидроизоляция жүргүзүү, натыйжалуу желдетүү системасын уюштуруу, дренаж системаларын колдонуу, туура жылуулоо жана имаратты үзгүлтүксүз техникалык тейлөө зарыл.",
    ),
    "humidity_title": MessageLookupByLibrary.simpleMessage(
      "Жогорулатылган нымдуулук",
    ),
    "inside_insulation_text": MessageLookupByLibrary.simpleMessage(
      "Артыкчылыгы – орнотуу салыштырмалуу оңой, ѳзгѳчѳ, эгер балкон буга чейин эле айнектелген болсо. Кемчилиги – жылуулоочу материалдардын эсебинен балкондун аянтынын азайышы.\n \nѲз колу менен жылуулоо үчүн курулуш жаатында  бир аз да болсо түпкү кѳндүмдѳргѳ жана керектүү материалдарды туура пайдалануу жѳндѳмүнѳ ээ болуу керек. \nКоопсуздук чараларын аткаруу менен процесстин ар бир кадамын кылдат аткаруу керек.\n",
    ),
