    "insul_install_ceiling_dot_1": MessageLookupByLibrary.simpleMessage(
      "Металл профилдер үчүн кронштейндерди орнотуңуз. Профилдер 500–600 мм кадам менен коюлат.",
    ),
    "insul_install_ceiling_dot_2": MessageLookupByLibrary.simpleMessage(
      "Пенополистирол үчүн клей-көбүк менен экструзияланган пенополистирол плиталарын даяр бетке бекитиңиз. Плиталарда кронштейндер үчүн оюкчалар каралышы керек.",
    ),
    "insul_install_ceiling_dot_3": MessageLookupByLibrary.simpleMessage(
      "Жылуулоочтун үстүнөн эки тараптуу скотч менен буу тосмосун (пароизоляция) бекитиңиз. Нахлесттер да эки тараптуу скотч менен жабыштырылат. Кронштейн өткөн жерлер металлизацияланган скотч менен кошумча жабыштырылышы мүмкүн.",
    ),
    "insul_install_ceiling_text": MessageLookupByLibrary.simpleMessage(
      "Шыпты барак материалдар менен (ГКЛ, ГВЛ, СМЛ, OSB, фанера ж.б.) кара бүтүрүүдө жылуулук изоляциялоо.\nШыпты барак материалдар менен бүтүргөндө татаал формадагы рельефтүү бет түзүүгө мүмкүнчүлүк болот.\nКронштейндердин аралыгы, саны жана узундугу алдын ала даярдалган долбоорго ылайык, барак жана бүтүрүү катмарларынын салмагын эске алуу менен тандалат.\nГипсокартон орнотуудан мурда жарык приборлорун жана розеткаларды туташтыруу үчүн электр кабелдерди өткөрүп коюу керек. Кабелдер ПВХ/ПНД түтүктөрдө же кабель-каналдарда жүргүзүлүшү зарыл.",
    ),
    "insul_install_ceiling_title": MessageLookupByLibrary.simpleMessage(
      "Шыпты жылуулоо",
    ),
    "insul_install_floor_dot_1": MessageLookupByLibrary.simpleMessage(
      "Даярдалган негизге жылуулоочу плиталарды коңшу катарлардагы тигиштерди жылдырып төшөңүз.",
    ),
    "insul_install_floor_dot_2": MessageLookupByLibrary.simpleMessage(
      "Чоң боштуктарды жылуулоочтун кесиндилери же пенополистирол үчүн клей-көбүк менен толтуруу сунушталат. Плиталарды полго механикалык бекитүү талап кылынбайт. Жылуулооч төшөлгөндөн кийин буу тосмо катмарын төшөңүз. Буу тосмо эркин төшөлөт, тигиштери эки тараптуу жабышчаак лента менен жабыштырылат. Нахлест кеминде 100 мм болушу керек.",
    ),
    "insul_install_floor_dot_3": MessageLookupByLibrary.simpleMessage(
