    "insul_install_walls_dot_1": MessageLookupByLibrary.simpleMessage(
      "Декоративдик шыбак менен бүткөрүлгөн балкондун дубалдарын жылуулоо үчүн фрезерленген беттүү экструзияланган пенополистирол колдонуу сунушталат. Эгер беттери жылмакай плиталарды колдонсоңуз, аларды темир щетка же араа менен бир калыпта фрезерлеп коюу керек.",
