    "insul_install_waterproof_dot_1": MessageLookupByLibrary.simpleMessage(
      "Герметизация жана беттерди тегиздөө бүткөндөн кийин пленка төшөсө болот. Көбүнчө пенофол же полиэтилен колдонулат. Эгер пенофол төшөсөңүз, чагылдыруучу тарабы жогору карап турушу керек. Тигиштер фольгалуу скотч менен бекитилет.",
