    "insul_install_waterproof_dot_2": MessageLookupByLibrary.simpleMessage(
      "Гидроизоляция катмары кең баштуу өзүн-өзү бурагыч бурамалар менен бекитилет, ал эми пленканын кошулган жерлери фольгалуу скотч менен жабыштырылат.",
    ),
    "insul_install_waterproof_text": MessageLookupByLibrary.simpleMessage(
      "Балкондун гидроизоляциясы — ачык аянтты жаан-чачындан коргоо үчүн зарыл шарт. Гидроизоляция тосмосу болбосо, конструкция элементтери бузулуп, көгөрүү жана көк пайда болушу мүмкүн, ошондой эле кошуналар менен көйгөй жаралышы ыктымал. Жылуулоочу материалдын астына гидроизоляция кылууда нымды көп сиңирген материалдар (мисалы, минералдык пахта) колдонуларын эске алуу керек.",
