    "prep_work_2_text_2": MessageLookupByLibrary.simpleMessage(
      "Чаң-топуракты жана ашыкча буюмдарды алып салыңыз. Дубал, пол жана шыптагы эски боёк, обой ж.б. тазалансын. Таза бет жаңы материалдардын жакшы жабышуусун камсыздайт.",
