    "prep_work_2_text_3": MessageLookupByLibrary.simpleMessage(
      "Бардык тигиштерди жана жаракаларды бүтөңүз. Майда жаракаларды герметик менен, чоң жылчыктарды монтаждык көбүк менен бекитсе болот. Бул нымдын кирүүсүн алдын алат жана жылуулоого бекем негиз түзөт.",
    ),
    "prep_work_2_text_4": MessageLookupByLibrary.simpleMessage(
