    "roof_attic_intro": MessageLookupByLibrary.simpleMessage(
      "     Үйдүн чердак жабуусун жылуулоо бөлмөнүн ичинде көбүрөөк жылуулукту сактоого жардам берет жана муздак чердакты жылытууга кеткен чыгымды азайтат. Ошондуктан муздак чердактын жабуусун жылуулук изоляциялоочу материалдар менен жылуулоо маанилүү. Муну эң жакшысы имарат курулуп жаткан кезде же бөлмөнүн таза жасалгасына чейин жүргүзүү керек. Бирок үй колдонууда да чердак тараптан шып жабуусун жылуулоого эч кандай тоскоолдук жок.",
    ),
    "roof_attic_section_claydite_text": MessageLookupByLibrary.simpleMessage(
      "Плита жаракалар жана щелдер бар-жогун текшерилет. Алар эритме менен бүтөлөт же калың кагаз менен жабылат. Чыгып турган элементтер керамзит төгүүгө тоскоол болбойт.\nБрус менен обрешетка орнотулат. Кийин ага кара пол төшөлөт.\nСыпма жылуулоочу материал плитанын үстүнө төгүлүп, кадимки тырмоо менен тегизделет. Катмар калыңдыгы 250–300 мм. Керамзиттин үстү менен эркин жүрсө болот.\nКеңеш: керамзит төккөндө ар кандай өлчөмдөгү гранулаларды аралаштырсаңыз, боштук пайда болбойт.\nАкырында кара пол орнотулат же кум-цемент стяжкасы куюлат.",
    ),
    "roof_attic_section_claydite_title": MessageLookupByLibrary.simpleMessage(
      "Керамзит менен жылуулоо.\n",
    ),
    "roof_attic_section_insulation_text": MessageLookupByLibrary.simpleMessage(
      "Бул этапта жылуулоочу материал (минералдык жүн, пенопласт же экструдирленген пенополистирол) төшөлөт. Бул абдан жөнөкөй процесс: плиталар же тилкелер керектүү өлчөмгө курулуш бычагы менен оңой кесилет.\nТөшөөдө боштук калбашына жана минералдык жүн катуу кысылып калбашына көңүл буруңуз. Экөө тең жылуулоонун сапатын төмөндөтөт. Сүрөттө типтүү каталар көрсөтүлгөн.",
    ),
    "roof_attic_section_insulation_title": MessageLookupByLibrary.simpleMessage(
      "Жылуулоо.\n",
    ),
    "roof_attic_section_vapor_text": MessageLookupByLibrary.simpleMessage(
      "Иш пароизоляциялык пленканы төшөөдөн башталат. Ал жылытуу бөлмөдөн көтөрүлгөн бууну муздак чердакка өтүүдөн коргойт. Пленканы туура төшөө үчүн анын бетиндеги белгилөөлөрдү кылдат караңыз. Милдеттүү түрдө 100 мм кабатташтыруу керек.\nЭгер жылуулоо жыгач балкалар боюнча жасалса, пленка бардык чыгып турган элементтерди айланып өтүшү керек. Болбосо балкалар чирип кетиши мүмкүн.\nПленканын дубалдар же башка чыгып турган беттер менен кесилишкен жерлеринде аны жылуулоонун калыңдыгына кошумча 50 мм көтөрүп, скотч менен бекитүү же жылуулоочу плитанын үстүнө ороп коюу керек.",
