    "roof_attic_section_waterproof_text": MessageLookupByLibrary.simpleMessage(
      "Чердак жабуусун жылуулоо гидроизоляция жана кара полду жасоо менен аяктайт. Минералдык жүн нымды сиңиргендиктен, анын үстүнө гидроизоляция төшөө керек. Бул ошондой эле жылуулоонун үстүнө бетон стяжка куюлса да зарыл.\nЭгер чердак дайыма колдонулса, мындай «жылуулоочу пирогдун» үстүнө кара пол жасоого болот: бетон стяжка же OSB плиталары ылайыктуу. Эгер чердак дээрлик колдонулбаса, анда болгон балкалардын үстүнө тактайларды эле төшөп койсо жетиштүү — зарыл учурда чердакка чыгуу жана жүрүү жеңил болот.",
    ),
    "roof_attic_section_waterproof_title": MessageLookupByLibrary.simpleMessage(
