    "roof_description_1": MessageLookupByLibrary.simpleMessage(
      "Имараттын чатыры аркылуу жалпы жоготуулардын болжол менен 25-30 пайызы кетет. Бул үйлөрдө жылуулук көпүрөлөрү пайда болгон дагы бир жалпы жер. Эреже катары, мансардалардагы жана чердактардагы жылуулук жоготуулар тышкы дубалдар менен чатырдын көтөрүүчү конструкциясынын ортосундагы жылуулук изоляциясынын туура эмес туташтырылышынан келип чыгат.",
    ),
    "roof_general_text": MessageLookupByLibrary.simpleMessage(
      "- Чатырлар жана жабуулар үчүн тыгыздыгы 250 кг/м3дөн ашпаган жана жылуулук өткөрүмдүүлүгү 0,06 Вт/(м∙°С) дан жогору эмес материалдар колдонулат. Материалдар өрт коопсуздугуна жооп берип, гигиеналык сертификаты болуп, уулуу заттарды бөлүп чыгарбоого тийиш.\n- Чатырды жылуулоо мансардада жашоочу бөлмөлөр пландалганда жасалат. Эгер пландалбаса, үйдүн үстүңкү жабуусунун үстүн (шыптын үстүн) гана жылуулоо жетиштүү.\n- Мансарданы жылуулоодо эңкейиш жана тик беттер үчүн плиталык жылуулоо колдонулат — рулондук материалдын ылдый жылып кетишин жана желдетилүүчү ажырымдын жабылып калышын алдын алуу үчүн. Минералдык пахта плиталары «распор» менен орнотулат.\n- Жылуулоону финиш жабууну орнотууга чейин (сырттан) да, кийин (ичтен) да жасоого болот — аба ырайына жана монтаж шартына жараша. Коньок бөлүгү төмөн чатырларды ичтен орнотуу ыңгайлуу, ал эми бийик жана чоң эңкейиштүү чатырларды сырттан орнотуу жеңилирээк.\n- Плиталарды үстүнөн төшөө көтөрүп чыгууга караганда оңой. Күз-кышта жылуулоону көбүнчө ичтен жасоо ыңгайлуу. Стропиланын кадамы адатта 600 мм болуп, көпчүлүк өндүрүүчүлөрдүн плиталарынын калыңдыгына туура келет.\nТөмөндө минералдык пахта менен жылуулоо ыкмасы сүрөттөлгөн, бирок башка материалдар үчүн да технологиясы окшош.",
