    ),
    "roof_inside_step_2_3": MessageLookupByLibrary.simpleMessage(
      "2. Пароизоляция үйдүн ичинен стропилдердин ылдыйкы учтарына степлер менен бекитилет. Гидроизоляциялык мембраналардын жана плёнкалардын түрлөрү көп, кайсынысын колдонуу колдонуучунун мүмкүнчүлүгүнө жараша тандалат.\n3. Андан соң стропилдердин аралыгына туура өлчөмдө кесилген жылуулоочу материал (минералдык жүн же пенополистирол) орнотулат. Ал өзүнүн ийкемдүүлүгү менен убактылуу кармалып турушу мүмкүн, бирок ишенимдүүлүк үчүн жип менен бекитүү сунушталат.",
    ),
    "roof_inside_step_4": MessageLookupByLibrary.simpleMessage(
      "4. Жылуулоочу материал бекитилгенден кийин пароизоляция катмары төшөлөт. Бул конденсаттын топтолушун жана жылуулоочунун нымдалышын алдын алган плёнкалык материал. Көбүнчө пергамин, полиэтилен же полипропилен плёнкалары колдонулат. Катмарлар степлер менен бекитилип, муундары скотч менен жабыштырылат.",
    ),
