    "roof_intro": MessageLookupByLibrary.simpleMessage(
      "    Суук мезгилде чатыр аркылуу жылуулук жоготуулар бир-эки кабат үйлөрдө 30—35%, көп кабат үйлөрдө 5—10% түзөт. Натыйжалуу жылуулоо системаларын колдонуу отопление үчүн энергия керектөөнү 10 эсеге чейин кыскарта алат. Бөлмөлөрдүн функционалдык же технологиялык максатына жараша, эксплуатациядагы жылуулук-ным режими камсыздалышы керек.",
