    "roof_link_action": MessageLookupByLibrary.simpleMessage(
      "ЧАТЫРДЫ ЖЫЛУУЛОО",
    ),
    "roof_link_text": MessageLookupByLibrary.simpleMessage(
      "Имараттын чатырын жылуулоо жөнүндө кененирээк маалыматты бул бөлүмдөн окуй аласыз: ",
    ),
    "roof_outside_block_1_text": MessageLookupByLibrary.simpleMessage(
      "Жылуулоочу материал төшөлө электе пароизоляцияны жасоо керек.\nЧатырдын катмарлуу «пирогун» курууда пароизоляция абдан зарыл. Анын негизги милдети — каптаманын ичинде нымдын пайда болуп, топтолушуна жол бербөө. Эгер ным топтолуп калса, чатыр ичинен чирип, бузулуп башташы мүмкүн жана анын эксплуатациялык сапаты төмөндөйт.\nПароизоляция жылуулоочудан төмөн жайгашышы өтө маанилүү, антпесе жылуулоочу материал ылдыйдан чыккан бууну өзүнө сиңирип, шишип жана нымдалып калат.\nПароизоляция үчүн рулон түрүндөгү материалдарды колдонсо болот: полиэтилен, полипропилен, фольгалуу жана диффузиялык пленкалар.\nПароизоляция үчүн колдонулган бардык пленкалар ийкемдүү, жыртылууга чыдамдуу жана иштөөгө ыңгайлуу болушу керек. Пленка бекитүү учурунда жыртылып кетпеши жана бекиткичти жакшы «кармап» турушу маанилүү. Мисалы, катуу шамалда бутак кулап чатыр жабыркаса да, пароизоляция бүтүн бойдон калып, жоготууларды минималдашы керек. Идеалда пароизоляциянын калыңдыгы жылуулоо жана гидроизоляция катмарларынын жүгүн көтөрө ала тургандай болушу зарыл (эгер обрешетка же стропилдер чыдабай калса).",
    ),
    "roof_outside_block_1_title": MessageLookupByLibrary.simpleMessage(
      "1. Пароизоляция. ",
    ),
    "roof_outside_block_2_text": MessageLookupByLibrary.simpleMessage(
      "Жыгач устундардын арасына жылуулоочу материал төшөлөт. Тыгыз төшөө керек — боштук жана ажырым болбошу зарыл.\nЖылуулоону коньктон ылдый карай (жогортон ылдый) же негизден конькко карай (ылдыйдан жогору) төшөөгө болот.\nЭгер ылдыйдан жогору орнотулса, плиталарды бири-бирине бекем кысып коюу керек — бул ажырымдардын пайда болушун алдын алат. Эки катмар жылуулоо жасалса, төмөнкү катмандын муундары үстүнкү катмандын плиталары менен жабылышы керек (плиталарды жылдырып коюу). Эгер боштук табылса, аны ошол эле материал менен толук калыңдыгына чейин толтуруш керек. Бул үчүн боштуктан 1 см чоңураак өлчөмдө элемент кесилип, кысылып орнотулат. Бардык жылуулоо проекттик абалга келтирилгенден кийин гидроизоляция орнотулат.",
    ),
    "roof_outside_block_2_title": MessageLookupByLibrary.simpleMessage(
      "2. Жылуулоочу материалды орнотуу.\n",
    ),
    "roof_outside_block_3_text": MessageLookupByLibrary.simpleMessage(
      "Гидро-пароизоляция материалдарынын функциясы — жылуулоочу катмарды эксплуатациялык сапатын төмөндөтүүчү нымдан коргоо. Чатырга гидроизоляция пленкасын туура орнотуу жана вентиляциялык боштуктарды түзүү чатырдын кызмат мөөнөтүн кыйла узартат.\nГоризонталдык жана вертикалдык нахлёстторду сөзсүз сактоо керек. Полотнолордун үстү-үстүнө келген жерлеринде бутилкаучук негизиндеги скотч менен жабыштырууга болот. Гидроизоляциянын конструкция элементтерине тийишкен жерлеринде бутилкаучук лента менен жабыштыруу милдеттүү. Коньктогу нахлёст 200 мм болушу керек.\nГидроизоляцияны орнотууда пленканы катуу тартып керүүнүн кереги жок — стропилдердин ортосунда бир аз бош (провисание) калтыруу керек. Бул кийин стропиль системасы деформацияланганда жана суук маалда өлчөмдөр өзгөргөндө пленканын айрылып кетишин алдын алат.\nГидроизоляция пленкасы контррейка аркылуу бекитилет — ал чатыр вентиляциясы үчүн боштук түзөт. Гидроизоляция үстүндөгү вентиляциялык боштук кеминде 50 мм болушу зарыл. Контррейканы кең баштуу шифер мыктар менен бекитишет. Мембрана үстүнөн жыгач рейкасыз скоба же мык колдонууга болбойт.\nАндан кийин чатыр жабуусун төшөөгө болот.",
    ),
    "roof_outside_block_3_title": MessageLookupByLibrary.simpleMessage(
      "3. Гидроизоляция.\n",
    ),
    "roof_outside_intro": MessageLookupByLibrary.simpleMessage(
      "   Чатырдын жантайыңкы бөлүгүн жылуулоо иштерин фиништик жабуу жасала электе аткаруу ыңгайлуураак.",
    ),
    "roof_outside_title": MessageLookupByLibrary.simpleMessage(
      "СЫРТ ЖАГЫНАН\nЖЫЛУУЛОО",
    ),
    "roof_prep_text": MessageLookupByLibrary.simpleMessage(
      "1. Иштей турган бөлмөнүн желдетилишин камсыздап, жумуш аймагы жетиштүү жарык экенине ынаныңыз. Керек болсо кошумча жарык булактарын орнотуңуз.\n2. Ишке киришерден мурда кашаа/стропила системасын кылдат текшериңиз. Элементтер үстү-үстүнө кошулган жерлерде боштук болбошу керек. Мындай боштуктар көп учурда «суук көпүрө» болуп калат. Керек болсо монтаждык көбүк менен этият толтуруңуз.\n3. Жыгач конструкцияда чыгып турган мык же бурамалар бар-жогун текшерип, жаракат алып калбоого көңүл буруңуз.\n4. Бир нече таңгак жылуулоону ачып коюңуз. Азыркы жылуулоочулар таңгакта катуу кысылат, ошондуктан формасын калыбына келтирүүгө убакыт керек.\n5. Тығыздыгы же геометриясы бузулган жылуулоону колдонбоңуз. Иштөөдө материалдын түзүлүшүн бузбай, үстүнө оор нерсе койбоңуз.",
    ),
    "roof_prep_title": MessageLookupByLibrary.simpleMessage(
      "Чатырды жылуулоого даярдык этабы",
    ),
    "roof_reason_1": MessageLookupByLibrary.simpleMessage(
      "Жылуу аба дайыма шыпка көтөрүлөт, ошондуктан эң чоң температура айырмасы чатырга туура келет. Эгерде анын ишенимдүү жылуулук изоляциясы жок болсо, энергия үйдөн эч кандай тоскоолдуксуз чыгып кетет.",
    ),
    "roof_reason_2": MessageLookupByLibrary.simpleMessage(
      "Чатырдагы жабуунун бүтүндүгүн жана калыңдыгын текшериңиз, дубалдарга чектеш жерлерге өзгөчө көңүл буруңуз.",
    ),
    "roof_reason_3": MessageLookupByLibrary.simpleMessage(
      "Чатырлар көп учурда агат: эгер шыптан тамчылап жатса, бул жылуулоочу материал сууга каныгып, нымдап жаткандыгынын биринчи белгиси (натыйжада жылуулук абдан тез кетет).",
    ),
    "roof_reasons_title": MessageLookupByLibrary.simpleMessage(
      "Мунун себептери көп:",
    ),
    "roof_title": MessageLookupByLibrary.simpleMessage("ЧАТЫРДЫ ЖЫЛУУЛОО"),
    "seal_intro": MessageLookupByLibrary.simpleMessage(
