    "text_about_proj": MessageLookupByLibrary.simpleMessage(
      "«Жылуу үй» маалыматтык-окутуучу мобилдик тиркемеси «Таза Келечек» долбоорунун кичи гранттары программасы боюнча «Атмосферанын зыяндуу заттар менен булгануусун кыскартуу, митигация жана климаттын ѳзгѳрүүсүнѳ ыңгайлашуусу максатында имараттардын энергиялык натыйжалуулугу маселеси боюнча Кыргызстандын калкынын маалымдуулугун жогорулатуу» демилгесин ишке ашыруунун алкагында иштелип чыккан.\n\nМобилдик тиркеменин максаты – катуу отунду колдонууну кыскартуу үчүн имараттардын энергиялык натыйжалуулугу боюнча ѳлкѳ калкынын маалымдуулук деңгээлин жогорулатуу.\n\nИмараттардын энергиялык натыйжалуулугуна карай алгачкы кадам катары иштелип чыккан тиркеме, негизинен, элди үйлѳрүн жылуулук менен изоляциялоонун зарылдыгы жана маанилүүлүгү тууралуу маалымдоого, ошондой эле элди үйдү жылытууга кеткен акча каражатын үнѳмдѳѳ үчүн жылуулукту изоляциялоонун негизги усулдарын үйрѳтүүгѳ багытталган. Узак мѳѳнѳттү максаттаган бул тиркеме Кыргыз Республикасындагы шаарларда абанын булгануу деңгээлин тѳмѳндѳтүүгѳ жана климаттын ѳзгѳрүүсүнүн кесепеттерин ыңгайлаштырууга жана жумшартууга багытталган.\n\nМобилдик тиркемедеги маалымат баарына түшүнүктүү болуш үчүн жѳнѳкѳй тил менен берилген. Булак иретинде тиркеменин мазмундук бѳлүгүндѳ жеке иштеп чыгуулар, чакырылган эксперттердин эсептѳѳлѳрү, ошондой эле имараттардын энергиялык натыйжалуулугу жаатындагы ишке ашырылган буга чейинки долбоорлордун алкагында жарыяланган материалдар колдонулду, атап айтканда: полдорду жана шыптарды жылуулоо боюнча монтаждоочулар үчүн колдонмо (“Имараттарда энергияны рационалдуу пайдалануу – кыргыз ассоциациясынын потенциалын чыңдоо – фаза II”, ЕБРР), жеке турак үйлѳрдүн тышкы тосмо конструкцияларын жылуулоо боюнча техникалык чечимдердин каталогу (“КыргызНИИПСС”, ОФ “Camp Alatoo”, ГЭФ/ПРООН “Имараттардагы энергиялык натыйжалуулукту жакшыртуу” долбоору), СНиП КР 23-01-2013 Курулуш жылуулук техникасы (имараттардын жылуулук тосмосу), СП 23-101-2013 Имараттардын жылуулугун сактоону долбоорлоо, СНиП КР 23-02-00 Курулуштук климатология, ГОСТ 26602.2-99 Терезе жана эшик блоктору: аба ѳткѳрүмдүүлүгүн аныктоо усулу жана иликтѳѳгѳ алынган интернет-булактар.\n\n«Жылуу үй» мобилдик тиркемеси АКШ Мамлекеттик департаменти грантынын эсебинен каржыланды. Тиркемеде берилген пикирлер жана корутундулар авторлорго гана тиешелүү жана АКШнын Мамлекеттик департаментинин кѳз карашын чагылдырган эмес.\n\n«Жылуу үй» мобилдик тиркемеси К. И. Скрябин атындагы КНАУ демилгелик тобу (А. В. Кенжебаева, Б. Анарбек), ошондой эле чакырылган эксперттердин командасы (А. Ч. Орозобекова, В. О. Греб, Р. А. Мигранов, О. И. Элеманов, Н. К. Рысмендеева) тарабынан түзүлдү.\n\nИштеп чыгуучулардын жана эксперттердин бирдиктүү командасына терең ыраазычылык билдиребиз.",
    ),
    "text_planning": MessageLookupByLibrary.simpleMessage(
      "Жылуулоочтун жана материалдардын керектүү кѳлѳмүн баалаңыз. Сиз каалаган балкондун кѳлѳмүнѳ жана жылуулоо деңгээлине негизделиңиз.\n",
    ),
    "text_planning_1_1": MessageLookupByLibrary.simpleMessage(
      "Балконду/лоджияны кылдат карап чыгыңыз, зыянга учураган жерлерине, жаракаларга жана нымдуулуктун болуусуна кѳңүл бургула. Терезе менен эшикттердин абалын, алар герметикалуу жабылганына жана муздак абаны кирбегендигин текшериңиз.",
    ),
    "text_planning_1_2": MessageLookupByLibrary.simpleMessage(
      "Балкондун кирин, чаңын кетирип, ашыкча буюмдардан арылтып, дубалдардагы, полдогу эски боёкту, туз кагаздарды ж.б. алып таштаңыз. Дубал, шып, пол таза болсо, ал жаңы материалдардын мыкты адгезиясын (каптоочтун негиздин бети менен бекем жабышуу жѳндѳмү) камсыздайт.",
    ),
    "text_planning_1_3": MessageLookupByLibrary.simpleMessage(
      "Кошулган жерлерин жана жаракалардын баарын бүтѳгүлѳ. Майда жаракаларды жана жылчык-тешиктерди атмосферага туруктуу герметик менен жамаса болот. Ал эми чоңураак тешиктерди монтаждык кѳбүк менен бекитет. Бул жылуулооч үчүн бекем негизди камсыздоо жана нымдуулуктун кирүүсүн алдын алуу үчүн маанилүү.",
    ),
    "text_planning_1_4": MessageLookupByLibrary.simpleMessage(
      "Эгер сиз чатырдан же дубалдан, терезе же дагы башка нымдуулук булагынан суу кирүү, нымдуулук кѳйгѳйүнѳ кабылсаңыз, буларды жылуулоо мезгили башталганга чейин жоюуга тийишсиз. Нымдуулук жылуулоочко олуттуу зыян алып келип, аны кѳгѳрүп кетүүгѳ дуушар кылат.",
    ),
    "text_planning_2_1": MessageLookupByLibrary.simpleMessage(
      "Кыртышты даярдагандан кийин аны тегиздѳѳ, грунттоо керек. Бул кадамды калтырып кетпеш керек.",
    ),
    "text_planning_2_2": MessageLookupByLibrary.simpleMessage(
      "Алгач грунтту жакшылап аралаштырыш керек. Андан соң кисть же валик менен балкондун кыртышына грунтту шыбоо керек. Бир катмар шыбагандан кийин ал кургаганча күтүш керек.",
    ),
    "text_planning_2_3": MessageLookupByLibrary.simpleMessage(
      "Андан соң, болжолдуу бир саттан кийин экинчи катмарды шыбайт. Эки катмарды 3 сааттан кем эмес убакытта жакшылап кургатыш керек.  Грунтталгандан 1 сааттан кийин кармап кѳргѳндѳ кургак болот, бирок ал экинчи катмарды шыбоого али даяр эмес. Эгер ным болсо грунттоого болбойт. Эгер сиз муну жасай турган болсоңуз, анда кийинки каптоо жабышпайт, ошону менен бирге эле грунт катмары да бузулат.",
    ),
    "text_planning_2_4": MessageLookupByLibrary.simpleMessage(
      "Выравнивание поверхностей (стен, потолка, пола)",
    ),
    "text_planning_2_5": MessageLookupByLibrary.simpleMessage(
      "выполняется при необходимости.",
    ),
    "text_planning_3_1": MessageLookupByLibrary.simpleMessage("1. "),
    "text_planning_3_2": MessageLookupByLibrary.simpleMessage(
      "1. Шыпты тегиздѳѳ",
    ),
    "text_planning_3_3": MessageLookupByLibrary.simpleMessage(
      "– дубалга окшош (тѳмѳндѳ сүрѳттѳлдү) шыбак аралашмаларынын жардамы менен ишке ашырылат. Нымдуу процесстерди колдонууда шыпты тегиздѳѳнү дубал жана пол менен жүргүзүлүүчү иштерге чейин аткаруу сунушталат (Нымдуу процесс – гипс негизиндеги аралашманы, цемент шыбакты, плитканы колдонуу Катмарлары кургаганча убакыт талап кылынат).",
    ),
    "text_planning_4_1": MessageLookupByLibrary.simpleMessage("2. "),
    "text_planning_4_2": MessageLookupByLibrary.simpleMessage(
      "Дубалдарды тегиздѳѳ",
    ),
    "text_planning_4_3": MessageLookupByLibrary.simpleMessage(
      "– цемент-кум аралашмасынын жардамы менен жасалат. Аралашмалар даяр түрүндѳ, ошондой эле, түздѳн-түз иш ордунда даярдалышы мүмкүн.    \nТегиздѳѳчү аралашмалардын жардамы менен дубал бетин тегиздѳѳ үчүн Дубал тегиз болушу үчүн ын бетин тегиздѳѳ үчүн маяк усулун колдонуу сунушталат. Маяктарды бир бүтүн мейкиндикти түзүү үчүн орнотот. Маяктарды туура орнотуу үчүн вертикалдык абалды берип туруучу салмакташ (отвес) колдонулат. Туура кеткен бирдей мейкиндикти аныктоо үчүн негиздин бир четинен экинчи четине керилген жипти, же лазер деңгээлин колдонууга болот.",
    ),
    "text_planning_4_4": MessageLookupByLibrary.simpleMessage(
      "Шыбак менен коңшу маяктар ортосундагы мейкиндик толтурулат. Андан соң кеңдиги коңшу маяктардын ортосундагы аралыктан чоң түздѳѳчтүн жардамы менен шыбакты тегиздейт.",
    ),
    "text_planning_4_5": MessageLookupByLibrary.simpleMessage(
      "Маяки устанавливаются так, чтобы образовалась единая плоскость. Для правильной установки маяков применяются отвесы, которые задают вертикальное расположение. Для выведения единой плоскости по горизонтали можно использовать нитку, натянутую между крайними точками основания, либо воспользоваться лазерным уровнем. Штукатурным составом заполняется пространство между соседними маяками. Затем при помощи правила, ширина которого больше расстояния между соседними маяками, производится выравнивание нанесенной штукатурки. После нанесения выравнивающего слоя поверхность оставляют до полного отверждения штукатурной смеси.",
    ),
    "text_planning_5_1": MessageLookupByLibrary.simpleMessage("3. "),
    "text_planning_5_2": MessageLookupByLibrary.simpleMessage("Полду тегиздѳѳ"),
    "text_planning_5_3": MessageLookupByLibrary.simpleMessage(
      "– текшилѳѳ (стяжка) аркылуу жасалат (текшилѳѳ – бул полдун негизи менен акыркы каптоочтун, мисалы, линолеум) ортосундагы аралык катмар. Текшилѳѳнүн түрлѳрү:\n- Кургак/жыйнак текшилѳѳ негизинен, жылуулукту изоляциялоочу катмардын үстүндѳгү толук бүтѳ элек катмар үчүн колдонулат.\n- Жарым кургак – стандарттык цемент-кум аралашмасы колдонулат, бирок аралашма бат кургасын үчүн суу аз кошулат.\n- Нымдуу – цемент-кум эритмесинен жасалат.\n- Ѳзү тегизделүүчү (куйма пол) – цементтен, гипстен, кумдан, клейден жана пластификаторлордон жасалган атайын аралашма. Аралашма негизги каптоонун кем жерлерин жакшы толтурат жана балкондун/лоджиянын бардык аянтына жайылат.\nПолду тегиздѳѳ үчүн жылуулук изоляциялоочуну орнотуу алдында жарым кургак, нымдуу жана ѳзүн ѳзү тегиздѳѳчү текшилѳѳ.",
    ),
    "text_planning_5_4": MessageLookupByLibrary.simpleMessage(
      "Жарым кургак/нымдуу текшилѳѳ:\n",
    ),
    "text_planning_5_5": MessageLookupByLibrary.simpleMessage(
      "Жарым кургак/нымдуу текшилѳѳ аралашмасы бир тегиздикте орнотулган маяктар ортосуна тѳгүлүп, тууралооч менен тегизделет.",
    ),
    "text_planning_5_6": MessageLookupByLibrary.simpleMessage(
      "Ѳзүн ѳзү тегиздѳѳчү текшилѳѳ:\n",
    ),
    "text_planning_5_7": MessageLookupByLibrary.simpleMessage(
      "Ѳзүн ѳзү тегиздѳѳчү текшилѳѳ (куйма пол) маяктарды колдонбостон орнотулат. Шликер түрүндѳгү эритме керектүү калыңдыкта полдун бетине тѳгүлѳт. Андан ары текшилѳѳ тийиштүү бекемдикке жеткенче белгилүү  убакытка чейин (3-7 сутка) кармалып, андан кийин гана кийинки ѳндүрүш иштери үчүн даяр болот.",
    ),
    "thick_plaster_after_first_layer": MessageLookupByLibrary.simpleMessage(
      "Биринчи катмарды тегиздегенде анын калыңдыгын бүт бет боюнча текшерип, керек жерлерге эритме кошуу керек. Биринчи штукатурка катмарын сүйкөгөндөн кийин бетти кармоо (катуулаш) мезгилинде нымдуу кармоо талап кылынат (аба ырайына жараша болжол менен 1–3 сутка). Кургак жана жылуу абада штукатуркаланган бетти нымдап туруу сунушталат.\nБиринчи катмар үзгүлтүксүз сүйкөлүшү керек: терезе жана эшик ойдуңдарынын откосторун кошо камтып, бурчтарда жумуш тигиштери болбошу зарыл. Дубал бурчтары да үзгүлтүксүз катмар менен штукатуркаланып, бурчтун айланасына 100–300 ммге чейин эритме сүйкөлөт.",
    ),
    "thick_plaster_base_layer_text": MessageLookupByLibrary.simpleMessage(
      "Биринчи катмардын милдети — штукатурка тору менен күчөтүлгөн конструкциянын каркасы болуу. Ошондуктан биринчи катмарда тор эритме менен эки тарабынан тең толук жабылышы өтө маанилүү. Биринчи катмар үчүн эритменин чыгымы — 15–20 кг/м² (кургак аралашма өндүрүүчүнүн көрсөтмөсүнө ылайык даярдалат).\n\nШтукатурка эритмесин механикалык (насос) же кол менен болот шпатель аркылуу, торго жана жылуулоого басып сүйкөсө болот. Зарыл болсо тор минералдык жүн плитасынан бир аз ажыратылып, эритме анын эки тарабынан тең толук жабышы камсыздалат. Тор айрым жерлерде көтөрүлүп чыгып кетсе, аны эритменин ичине басып киргизип, атайын мырышталган мыктар менен бекитишет.",
    ),
    "thick_plaster_base_layer_title": MessageLookupByLibrary.simpleMessage(
      "Базалык штукатурка катмарын түзүү: ",
    ),
    "thick_plaster_brackets": MessageLookupByLibrary.simpleMessage(
      "Белгилер боюнча скобалар орнотулат жана дубалга ылайыктуу дюбелдер менен бекитилет. Скобага маятник рычаг салынып, жылуулоону оңой орнотуу үчүн 90° бурчта жогорку абалда фиксацияланат.",
    ),
    "thick_plaster_corners_note": MessageLookupByLibrary.simpleMessage(
      "Имараттын бурчтарында бүтүн жана жарым изоляция плиталарын гана төшөөгө болот. Бир эле материалдан болгон ≥ 150 мм «пригоночный» бөлүктөрдү катардагы зонада гана колдонсо болот жана эч качан четтерде колдонбоо керек. Ным болуп калган же бузулган плиталарды орнотууга болбойт.\n\nОрнотулган жылуулоочу плита плитаны кармап туруучу блоктоо элементи менен бекитилет. Анда 30–45° бурчта кесик жасалат. Маятник рычаг төмөнкү абалга түшүрүлөт, бул жүктү бекиткичке бирдей бөлүштүрүүгө мүмкүндүк берет.",
    ),
    "thick_plaster_fasteners_block": MessageLookupByLibrary.simpleMessage(
      "Бекиткичти орнотуу: бекиткичтерди орнотуудан мурун дубалдын түрүнө ылайык тандалган дюбель тешикке кагылат.\n\nВинт дюбелге бекиткич менен кошо берилген атайын шайман аркылуу буралат (кол менен же механикалык дрельге орнотуп).\n\nВинтти бураганда анын белгиленген тереңдикке киришин эске алуу керек.\nВинтти буруп, илмек вертикал абалга келгенде, илмекке крюк орнотуп, ал блоктоо абалын алышы керек.\n\nБекиткичтердин саны — изоляция калыңдыгы ≤ 100 мм болсо, кеминде 5 даана/м², ал эми бекитүүлөрдүн аралыгы 500 ммден ашпайт.\n\nЭгер изоляция калыңдыгы > 100 мм болсо, бекитүүлөрдүн саны кеминде 6 даана/м² болушу керек, ал эми аралык 400 ммден ашпашы зарыл. Бул талап четки зоналарга жана шамал жүгү күчөгөн бийик имараттардын жогорку кабаттарына да тиешелүү.\n\nБекиткичтен бурчка чейинки аралык 150 ммден ашпайт, терезе ойдуңуна чейин — 150 ммден ашпайт, деформациялык тигишке чейин — 250 ммден ашпайт.\n\nДубал тегиздигинде бекиткичтерди орнотуу схемасы",
    ),
    "thick_plaster_first_row_support_text": MessageLookupByLibrary.simpleMessage(
