    ),
    "thick_plaster_mesh_text": MessageLookupByLibrary.simpleMessage(
      "Торду орнотуудан мурун бекиткичтин бөлүгү болгон бардык крюктар блоктоо абалынан чыгарылганын жана белгиленген бурчка (кеминде 30°) коюлганын текшерүү керек.\n\nТор рулондун туурасына барабар тилкелер менен тартылат. Рулон жогорудан ылдый карай ачылат. Тордун нахлести кеминде 50 мм болушу керек.\n\nТор жогорудан ылдый жеңил тартылып, блоктоо шпилькасы менен фиксацияланат (же ар бир крюкка тордун үстүнөн эки блоктоо пластинкасын коюу аркылуу бекитилет). Шпилькаларды, мисалы, торду орнотууда кайра алып коюп жана кайра орнотсо болот. Пластинкаларды өтө катуу басууга болбойт — болбосо изоляция плитасында ойук пайда болот.\n\nТор штукатурканын биринчи катмарынын калыңдыгында жайгашуусу керек. Бул үчүн тор менен изоляциянын ортосуна пластик прокладкалар коюлат.",
