    "thin_plaster_decor_layer_text": MessageLookupByLibrary.simpleMessage(
      "оштукатуркаланган бет чаңдан тазаланат, андан соң валик/краскопульт/боёо тапанчасы менен алгач грунт 1 катмар, кийин боёо курамы 2 жолу толук жаап сүйкөлөт. Минералдык жүн жылуулоосу бар системада акрил декоративдүү штукатуркаларды колдонууга болбойт, анткени алардын буу өткөрүмдүүлүгү төмөн. Алар пенополистирол жылуулоосу бар системаларда гана чектелүү колдонулат. Жылуулоо системасы менен имарат конструкцияларынын ортосундагы боштуктар тигиш бою уплотнителдик шнур менен толтурулуп, герметик менен жабылат.",
