    "thin_plaster_point_text": MessageLookupByLibrary.simpleMessage(
      "негиздин тегиз эместиги 3 ммден жогору болгондо колдонулат. Плитанын контуру боюнча сүйкөлгөн клей тилкесинде аба «капчыктарын» болтурбоо үчүн үзүлүштөр болушу керек; чаптоодо клей бириккендей болуп, жылуулоонун астында абанын айланышын алдын алат. Адгезиялык контакт аянты монтаж бетинин ≥ 40% болушу керек.\n· Андан кийин минералдык жүн плиталары төмөнкү катмарга карата «перевязка» менен чапталат. Чаптоо имараттын бурчунан жана ойдуңдардан (терезе/эшик) башталып, сплошной дубалда (ойдуңдардын арасында же бурчтардын арасында) биригиши керек.",
