    "thin_plaster_reinforce_text": MessageLookupByLibrary.simpleMessage(
      "Фасад катмарларынын кеңейиши жана отурушу натыйжасында ички чыңалуулар пайда болуп, ойдуңдардын четтеринен сыртка карай кыйгач жаракалар түшүшү мүмкүн. Ошондуктан имараттын сырткы вертикал жана горизонтал бурчтарын, ошондой эле терезе/эшик ойдуңдарынын бурчтарын күчөтүү керек.\nМындай жаракаларды алдын алуу үчүн алюминий бурчтук профиль колдонулат: ал жылуулоонун үстүнө имараттын бурчтарына, ойдуңдарга, деформациялык тигиштерге чапталат жана бурчтук армирлөөчү тор колдонулат.",
