    "wall_inside_frame_finish": MessageLookupByLibrary.simpleMessage(
      "Андан соң каркас тандалган плиталар менен капталат — гипсокартон, ДСП жана башка.",
    ),
    "wall_inside_frame_mount_text": MessageLookupByLibrary.simpleMessage(
      "Дубалдын периметри боюнча сөзсүз түрдө пароизоляция пленкасы төшөлөт (минералдык жүн колдонулганда гана).\nПароизоляциянын үстүнөн жыгач брустардан каркас чогултулат. Металл профилди колдонуу сунушталбайт: металл жылуулукту жакшы өткөрөт жана «муздак көпүрө» болуп калат.",
