    "wall_inside_frame_warning": MessageLookupByLibrary.simpleMessage(
      "!!! Өрт коопсуздугу боюнча талаптары жогору объекттерде ичтен жылуулоодо металл каркас базальт жүн менен бирге колдонулушу керек. Буларга жыгачтан салынган курулуштар: мончо, сауна ж.б. кирет !!!",
    ),
    "wall_inside_heading": MessageLookupByLibrary.simpleMessage(
      "Дубалдарды ичтен жылуулоо процесси",
    ),
    "wall_inside_intro": MessageLookupByLibrary.simpleMessage(
      "Дубалды ичтен жылуулоо сырттан жылуулоо мүмкүн болбогондо же ылайыксыз болгондо колдонулат. Мисалы, имарат мурда эле курулуп, анын сырткы көрүнүшүн өзгөртүүгө болбой турган учурларда. Ички жылуулоону жылдын каалаган мезгилинде жасоого болот.\n\nКараганда, ичтен жылуулоо сырттан жылуулоого караганда жеңилирээк жана тезирээк көрүнөт. Бирок бул ыкманын бир нече кемчилиги бар:",
