    "wall_inside_prep_text": MessageLookupByLibrary.simpleMessage(
      "Каркассыз ыкма үчүн бети тегиз, чоң чуңкурлары жок дубал керек.\nГипсокартонду жылуулоочу катмар менен жабууда ишти обой, штукатурка, боёк калдыктарын тазалоодон баштайбыз. Эгер кирпичтен турган штукатуркасыз дубалга чаптоо керек болсо, чыгып турган эритмени толугу менен түшүрөбүз.\nЧуңкурлар жана жаракалар цемент-кум эритмеси менен толтурулат. Аны жеринде аралаштырабыз же даярын кап менен сатып алабыз.",
    ),
    "wall_inside_prep_title": MessageLookupByLibrary.simpleMessage(
      "Дубалды жылуулоочу материалды чаптоого даярдоо",
    ),
    "wall_inside_tech": MessageLookupByLibrary.simpleMessage(
      "Жылуулоо технологиялары: кургак, нымдуу, аралаш.\nДубалды ичтен жылуулоону орнотуу ыкмалары:\n1. Каркассыз,\n2. Каркастуу.\nКаркассыз ыкмада жылуулоочу материал негиз дубалга клей аркылуу бекитилет. Плита (панель) бекитүүнүн варианттары негиздин тегиз эмес болушуна жараша аныкталат. Каптаманын бийиктиги жылуулоочунун бийиктиги менен аныкталат.",
    ),
    "wall_inside_title": MessageLookupByLibrary.simpleMessage(
      "ИЧТЕН\nЖЫЛУУЛОО",
    ),
    "wall_insulation_link": MessageLookupByLibrary.simpleMessage(
      "ДУБАЛДАРДЫ ЖЫЛУУЛОО",
    ),
    "wall_intro_1": MessageLookupByLibrary.simpleMessage(
      "Дубалдарды жылуулоо — бул имараттын дубалдарынын жылуулук коргоо касиеттерин жакшыртуу процесси. Бул жылуулук жоготууларын азайтып, имараттын энергиялык натыйжалуулугун жогорулатат. Айрыкча турак жайлар үчүн ыңгайлуу жашоо шартын түзүү жана жылытуу менен салкындатууга кеткен чыгымдарды кыскартуу үчүн маанилүү.",
    ),
    "wall_intro_2": MessageLookupByLibrary.simpleMessage(
      "Дубалдар аркылуу жылуулук жоготуулар жалпы жоготуулардын 35–40% түзөт. Дубалдарга жылуулоочу катмар төшөлгөндө, ал кышында ички жылуулуктун сыртка чыгышына, жайында сырткы ысыктын ичкери киришине тоскоол болот.",
    ),
    "wall_material_heading": MessageLookupByLibrary.simpleMessage(
      "Материалды тандоодо",
    ),
    "wall_material_text": MessageLookupByLibrary.simpleMessage(
      "жылуулук өткөрүмдүүлүк коэффициентине жана калыңдыгына көңүл буруу керек: калыңдык негизги конструкциялык материалга жана курулуш жүргүзүлө турган жердин климаттык өзгөчөлүктөрүнө жараша тандалат. Ошондой эле материалдын баасы жана рынокто жеткиликтүүлүгү маанилүү.\nБиздин рынокто дубалдарды жылуулоо үчүн эң кеңири колдонулган материалдар:\n- минералдык жүн\n- пенопласт\n- экструдирленген пенополистирол.\nТөмөндө минералдык жүн мисалында сүрөттөлгөн жылуулоо ыкмасы пенопласт жана экструдирленген пенополистирол сыяктуу башка плиталык материалдарга да ылайыктуу. Айырмасы негизинен дюбелдин (бекиткичтин) түрүн жана узундугун тандоодо болушу мүмкүн.",
    ),
    "wall_material_title": MessageLookupByLibrary.simpleMessage(
      "МАТЕРИАЛДЫ\nТАНДОО",
    ),
    "wall_prep_01": MessageLookupByLibrary.simpleMessage(
      "Иштерди орточо суткалык температура +5тен +30°Cке чейин, ал эми шамалдын ылдамдыгы 10 м/стен төмөн болгондо жүргүзүү сунушталат.",
    ),
    "wall_prep_02": MessageLookupByLibrary.simpleMessage(
      "Кышында монтаж иштерин жүргүзгөндө курулуш лесаларын периметри боюнча 1–2 катмар пленка менен жаап, температураны +5°Cтен төмөн түшүрбөй кармоо үчүн жылуулук пушкаларын орнотуу керек.",
    ),
    "wall_prep_03": MessageLookupByLibrary.simpleMessage(
      "Курулуш операциялары алмашкан сайын жана өзгөчө фиништик декоративдүү катмарды сүйкөөгө чейин подмосттордун тазалыгын камсыз кылуу керек. Бул кир-чаңдын системанын нымдуу катмарларына түшүп кетишин алдын алат.",
    ),
    "wall_prep_04": MessageLookupByLibrary.simpleMessage(
      "Фасадды жылуулоо системасын орнотууга чейин бардык ички «нымдуу» иштер (бетон, штукатурка, пол иштер ж.б.) бүткөрүлүп, терезе-эшик ойдуңдары толтурулуп, чатыр жабуусу толук аякташы керек.",
    ),
    "wall_prep_05": MessageLookupByLibrary.simpleMessage(
      "Иш баштаар алдында фасад бетинин вертикал боюнча реалдуу четтөөлөрүн жана беттердин абалын аныктоо зарыл.",
    ),
    "wall_prep_06": MessageLookupByLibrary.simpleMessage(
      "Жылуулоону орнотууга чейин негизди даярдап, бардык көмөкчү элементтерди демонтаж кылуу керек. Жаңы курулушта кирпич кыштоо жана минералдык штукатуркалардын «жашы» кеминде 28 күн, бетондуку кеминде 3 ай болушу зарыл.",
    ),
    "wall_prep_07": MessageLookupByLibrary.simpleMessage(
      "Фасадды орнотуудан мурун жылуулоочу плиталардын толук жабышышына тоскоол болгон элементтердин баарын алып салуу керек: суу агызгыч түтүктөр, отливдер, чырактар, кондиционердин сырткы блоктору, кронштейндер ж.б.",
    ),
    "wall_prep_08": MessageLookupByLibrary.simpleMessage(
      "Коммуникацияларды чыгаруу: фасадда жайгашкан газ түтүктөрү, анодно-катоддук коргоо блоктору, күч кабелдери же башка коммуникациялар долбоордук чечимге ылайык жана бул коммуникацияларды тейлеген адистешкен уюмдун өкүлүнүн катышуусунда жылдырылышы керек.",
    ),
    "wall_prep_09": MessageLookupByLibrary.simpleMessage(
      "Терезе жана эшиктерди коргоо: иш учурунда терезе жана эшик блокторун булгануудан тунук пленкалар менен коргоо зарыл.",
    ),
    "wall_prep_10": MessageLookupByLibrary.simpleMessage(
      "Фасадды механикалык тазалоо: чаң, кир, туз чөгүндүлөрү, цемент/акиташ эритмеси жана боёктордун калдыктары балка, щетка жана суу менен алынышы керек. Кыйын булгануулар үчүн атайын курамдарды колдонуңуз.",
    ),
    "wall_prep_11": MessageLookupByLibrary.simpleMessage(
      "Чачырап турган жана бекем эмес участокторду алып салуу: бетон/эритме томпокторун алып, жаракаларды жана чуңкурларды тегиздеңиз. Эски штукатурка канааттандырарлык болсо калтырса болот, бирок бекем эмес жерлер жылуулоо системасын баштаар алдында сөзсүз алынышы керек. Эски штукатурка бүт бетинде такылдатуу менен текшерилип, боштук табылган жерлер уруп түшүрүлүп, калыбына келтирилет (реконструкцияда).",
    ),
    "wall_prep_12": MessageLookupByLibrary.simpleMessage(
      "Негизди тегиздөө: тереңдиги 10 ммден ашкан тегиз эмес жерлер тегиздөөчү эритме менен толтурулат. Тереңдиги 15 ммден ашкан жана аянты 0,5 м²ден чоң участоктор эритме жана таш жүн (каменная вата) менен тегизделет. Материалды тандаганда бекемдик талаптарын эске алыңыз.",
    ),
    "wall_prep_13": MessageLookupByLibrary.simpleMessage(
      "Биологиялык булганууларды тазалоо: козу карын жана мох атайын антисептик курамдар менен алынат. Кайра пайда болбошу үчүн негизги себеп табылып, жоюлушу керек.",
    ),
    "wall_prep_14": MessageLookupByLibrary.simpleMessage(
      "Металл элементтерин коргоо: жылуулоонун астында кала турган бардык металл бөлүктөр даттан тазаланып, антикоррозиялык грунтовка менен иштетилиши керек.",
    ),
    "wall_prep_15": MessageLookupByLibrary.simpleMessage(
      "Эски штукатурканын көтөрүмдүүлүгүн текшерүү: кургак жана нымдуу абалда бекемдигин текшерүү үчүн проволока щетка менен сүртүңүз. Эгер штукатурка үгүлсө — аны алып салуу керек. Катмар катуулугун текшерүү үчүн отвертканын жалпак жагы менен бетин басым жасап сыйрыңыз. Эгер терең чийиктер калса — эски штукатурканы алып салуу зарыл.",
    ),
    "wall_prep_16": MessageLookupByLibrary.simpleMessage(
      "Эски штукатурканын астындагы боштуктарды аныктоо: бетти өзгөчө жарака бар жерлерде кылдат текшерүү керек. Балка же металл таяк менен такылдатып, үнү бүдөмүк чыккан боштук жерлерде эски штукатурканы уруп түшүрүңүз.",
    ),
    "wall_prep_17": MessageLookupByLibrary.simpleMessage(
      "Негизди грунтовкалоо: фасадды тазалоодо суу бат сиңип кетсе, бул негиздин сиңирүү жөндөмү жогору экенин көрсөтөт жана бул клейдин бекемделишине терс таасир берет. Негизди бекемдөө жана клейдин жабышуусун камсыз кылуу үчүн фасад бети грунтовка менен капталышы керек. Грунт атайын кисть менен эки жолу сүйкөлөт.",
