    ),
    "wall_process_02": MessageLookupByLibrary.simpleMessage(
      "Клей курамын тандоо: фасад үчүн атайын клей аралашмалары же универсалдуу штукатурка-клей курамдары колдонулат. Алар жылуулоочу плиталарды негизге чаптоого да, жылуулоонун үстүнө базалык штукатурка катмарын түзүүгө да жарайт. Пенополистирол үчүн клей-көбүк экструзияланган пенополистирол (XPS) жана пенополистирол плиталарын негизге бекитүүдө колдонулат (сырт/ич дубалдар, чатыр, жер төлө, фундамент, пол — жаңы жана реконструкцияланган имараттарда). Аралашманы тандаганда колдонуу чөйрөсүн жылуулоочунун түрүнө жараша тактоо керек.",
    ),
    "wall_process_03": MessageLookupByLibrary.simpleMessage(
      "Клей аралашмасын даярдоо: сапаттуу эритме алуу үчүн алдын ала так өлчөнгөн таза муздак суу (15–20°C) керек. Көлөмү белгиленген (кеминде 10 л) шкаласы бар идиш даярдап/сатып алыңыз. Керектүү сууну клей аралашмасын даярдай турган чакага куюңуз. Сууга кургак аралашманы акырындан кошуп, түйүнчөксүз бир тектүү масса болгонго чейин аралаштырыңыз. Керектүү консистенция алынгандан кийин 5 мүнөт тыныктырып, кайра аралаштырыңыз. Аралаштырууну 400–800 ай/мин ылдамдыкта насадкасы бар дрель менен же курулуш миксери менен жүргүзүшөт. Даяр болгон аралашма 1,5 сааттын ичинде колдонулушу керек. Иштөө учурунда кошумча суу кошууга болбойт. Пластикалуулугун сактоо үчүн аралашманы кайра аралаштырып койсо болот.",
